import React, { useState } from "react";
import { evaluate } from "mathjs";
import { FaBold, FaItalic, FaFont, FaTrash, FaPlus, FaMinus, FaTable, FaSortNumericDown, FaArrowUp, FaArrowDown, FaCut, FaSearch, FaEllipsisH, FaCalculator, FaPlusCircle, FaMinusCircle, FaChartBar, FaHashtag, FaSave, FaFolderOpen, FaTextHeight, FaTextWidth, FaSortAmountDown, FaSortAmountUp, FaHashtag as FaCount, FaEdit, FaRegCheckSquare, FaArrowCircleUp, FaArrowCircleDown, FaEraser, FaSyncAlt } from "react-icons/fa";
import "./spreadSheet.css"

const Spreadsheet = () => {
    const [cells, setCells] = useState(Array(10).fill(null).map(() => Array(10).fill("")));
    const [selectedCells, setSelectedCells] = useState([]);
    const [formula, setFormula] = useState("");
    const [isFormulaMode, setIsFormulaMode] = useState(false);
    const [findValue, setFindValue] = useState("");
    const [replaceValue, setReplaceValue] = useState("");

    const handleCellChange = (row, col, value) => {
        const newCells = cells.map((r, i) => r.map((c, j) => (i === row && j === col ? value : c)));
        setCells(newCells);
    };

    const handleCellClick = (row, col) => {
        setSelectedCells([[row, col]]);
    };

    return (
        <div className="spreadsheet">
            <div className="toolbar" style={{ display: 'flex', gap: '10px' }}>
                <button onClick={() => applyMathFunction("SUM")}><FaPlusCircle /> Sum</button>
                <button onClick={() => applyMathFunction("AVG")}><FaMinusCircle /> Average</button>
                <button onClick={() => applyMathFunction("MIN")}><FaSortAmountDown /> Min</button>
                <button onClick={() => applyMathFunction("MAX")}><FaSortAmountUp /> Max</button>
                <button onClick={() => applyMathFunction("COUNT")}><FaCount /> Count</button>
                <button onClick={() => setIsFormulaMode(true)}><FaEdit /> Enter Formula</button>
                <div className="dropdown">
                    <button className="dropbtn"><FaEllipsisH /> Data Quality</button>
                    <div className="dropdown-content">
                        <button onClick={() => applyDataQualityFunction("UPPER")}><FaArrowCircleUp /> Upper</button>
                        <button onClick={() => applyDataQualityFunction("LOWER")}><FaArrowCircleDown /> Lower</button>
                        <button onClick={() => applyDataQualityFunction("TRIM")}><FaEraser /> Trim</button>
                        <button onClick={() => applyDataQualityFunction("REMOVE_DUPLICATES")}><FaSyncAlt /> Remove Duplicates</button>
                        <input type="text" placeholder="Find" value={findValue} onChange={(e) => setFindValue(e.target.value)} />
                        <input type="text" placeholder="Replace" value={replaceValue} onChange={(e) => setReplaceValue(e.target.value)} />
                        <button onClick={() => applyDataQualityFunction("FIND_REPLACE")}><FaSearch /> Find & Replace</button>
                    </div>
                </div>
            </div>
            <table>
                <thead>
                    <tr>
                        <th></th>
                        {cells[0].map((_, colIndex) => (
                            <th key={colIndex}>{String.fromCharCode(65 + colIndex)}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {cells.map((row, rowIndex) => (
                        <tr key={rowIndex}>
                            <th>{rowIndex + 1}</th>
                            {row.map((cell, colIndex) => (
                                <td key={colIndex} onClick={() => handleCellClick(rowIndex, colIndex)}>
                                    <input
                                        value={cell}
                                        onChange={(e) => handleCellChange(rowIndex, colIndex, e.target.value)}
                                    />
                                </td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Spreadsheet;
